def calculate_max_efficiency(n, U, energies):
    i = 1
    j = 1
    max_efficiency = -1
    while not (i == j and i == n - 1):
        if j <= i:
            j += 1
        if j < n - 1:
            if energies[j + 1] - energies[i] <= U:
                j += 1
            else:
                if j - i >= 2:
                    max_efficiency = max(max_efficiency, (energies[j] - energies[i + 1]) / (energies[j] - energies[i]))
                i += 1
        else:
            if j - i >= 2:
                max_efficiency = max(max_efficiency, (energies[j] - energies[i + 1]) / (energies[j] - energies[i]))
            i += 1
    if max_efficiency == -1:
        return -1
    else:
        return max_efficiency

